Avenging Spider-Man was the precursor to the current Superior Spider-Man Team-Up, and featured the webslinger joining forces with various colleagues and friends from the Marvel Universe to defeat the big baddies. Many notable writers took a stab at individual issues, includng Mark Waid, Kelly Sue DeConnick, Greg Rucka, and longtime and current Spidey scribe Dan Slott. Some great artists worked on the series as well, including Stuart Immonen and Paco Medina. This torrent features all 23 issues of the main series, as well as the Annual and the Daily Bugle special. All copies are digital, thanks to the combined work of TheGroup, Minutemen-InnerDemons, and Empire. Please seed, and enjoy! :-)
